export default function Api(){
    const [data, setData] = useState({})

    function getData  () {
        fetch('data/data.json')
        .then((res) => res.json())
        .then((logedata) => {
            console.log(logedata)
            setData(logedata)
        })
    }

useEffect(() => {
    getData()
},[])

return data

}
